import styled from "styled-components";

export const StyledHeader = styled.header`
    display: flex;
    flex-direction: column;
    justify-content: center;
    width: 100%;
    height: 130px;
    border-top: 1px solid var(--color-grey-3);
    padding-left: 20px;
    gap: 15px;
    margin-top: 6rem;
`
